    false,nt"url": null,nt"notes": "This memo summarizes an investigation that
    took place after a massive fish kill in 5 of the 6 ponds on St. Vincent National
    Wildlife Refuge. Two days of field investigations indicated that sport-fish (largemouth
    bass, bluegill sunfish, redear sunfish, and striped mullet) populations had been
    partially or completely eliminated in 5 of the 6 ponds managed for sport-fishing
    on St. Vincent National Wildlife Refuge. Standard sampling techniques were utilized
    to determine the extent of the loss of sport-fish in each of the ponds. A lake u201cturnoveru201d
    most likely occurred during Hurricane Elena which caused the loss of the natural
    replenishment of oxygen. This triggered the fish kill. A water quality analysis
    and an article titled u201cA color variation of the bluegill sunfish, Lepomis macrochirusu201d
    are attached.",nt"license_title": "License Not Specified",nt"extras":
